import React, {Component} from "react";
import CardList from "./CardList";
import { robots } from "./Robot";
import SearchBox from "./SearchBox";



class App extends Component {
    constructor(){
        super()
        this.state = {
            robot: robots,
            searchfield: ''
        }
    }
    render(){
        return (
            <div className='tc'>
                <h1>RoboFriends</h1>
                <SearchBox />
                <CardList robots={robots}/>
            </div>
        );
    }

}

export default App;
